      relatedID: 'nothing', // keep it, don't change
      config: {
        module: "Crypto",
        description: Dot(
          "fletcher64.config.desc",
          "The Fletcher checksum is an algorithm for computing a position-dependent checksum. It provides error-detection properties with less computational effort than a cyclic redundancy check."
