        infoURL: "https://wikipedia.org/wiki/Fletcher%27s_checksum#Fletcher-64",
        inputType: "ArrayBuffer",
        outputType: "string",
        flowControl: false,
        manualBake: false,
        args: []
      },
      infoURL: 'https://en.wikipedia.org/wiki/Fletcher%27s_checksum#Fletcher-64',
      nousenouseID: 'fletcher64',
      optName: Dot("fletcher64.optName", "Generate {0} Checksum", "Fletcher-64"),
      optDescription: Dot(
        "fletcher64.optDesc",
        "This operation computes a {0} checksum for the input data.",
        "Fletcher-64"
      ),
      exampleInput: "", // Fill it if possible
      exampleOutput: "<Fletcher-64 checksum string>", // Placeholder for actual output
    };
  }

  /**
   * @param {ArrayBuffer} input
   * @param {Object[]} args
   * @returns {string}
   */
  run(input, args) {
    let a = 0,
      b = 0;
    if (ArrayBuffer.isView(input)) {
      input = new DataView(input.buffer, input.byteOffset, input.byteLength);
    } else {
      input = new DataView(input);
    }

    for (let i = 0; i < input.byteLength - 3; i += 4) {
      a = (a + input.getUint32(i, true)) % 0xffffffff;
      b = (b + a) % 0xffffffff;
    }
    if (input.byteLength % 4 !== 0) {
      let lastValue = 0;
      for (let i = 0; i < input.byteLength % 4; i++) {
        lastValue = (lastValue << 8) | input.getUint8(input.byteLength - 1 - i);
      }
      a = (a + lastValue) % 0xffffffff;
      b = (b + a) % 0xffffffff;
    }

    return Utils.hex(b >>> 0, 8) + Utils.hex(a >>> 0, 8);
  }
}

